import React from "react";

export default function Input () {
    return (
        <form action="/action_page.php">
        <input type="text" id="fname" name="fname"/>
  
        <input type="text" id="lname" name="lname"/>
        <input type="submit" value="Submit"/>
        </form>
    )
}
